import React,{Component} from 'react';
import Person from './persons'

function NameList(){
	const persons = [
		{
			name:'Bob',
			id:'2'
		},
		{
			name:'Mark',
			id:'3'
		}]
        const personList = persons.map(person => <Person props={person} />)
	    return <div>{personList}</div>
}	
export default NameList
